import "./Header.css";

const Header = () => {
  return (
    <section className="header9">
      <h3 className="h39">과제 제목</h3>
      <div className="content-container1">
        <div className="heroicons-outlinex28">
          <img
            className="vector-icon75"
            loading="lazy"
            alt=""
            src="/vector1.svg"
          />
        </div>
      </div>
    </section>
  );
};

export default Header;
